import React from 'react';
import "../css/Main.css";

function Main() {
  return (
    <div className="mainbox">
      <div className="mainmenu">
        <div className="tourindex">

        </div>
        <div className="smallmenu">
          바보
          <div>
            <div className="visitormenu"></div>
            <div className="costmenu"></div>
          </div>
          <div>
            <div className="toursearch"></div>
            <div className="keywordsearch"></div>
          </div>
        </div>

      </div>
      <div className="tourindexmap">

      </div>
    </div>
  );
}

export default Main;
